import React from "react";

function Card() {
  return (
    <div>
      <div>
        <li>{Array.id}</li>
        <li>{Array.name}</li>
        <li>{Array.age}</li>
        <li>{Array.degree}</li>
      </div>
    </div>
  );
}

export default Card;
